namespace Quid\Suite\Col {
use Quid\Core;
use Quid\Orm;
use Quid\Base;

\Quid\Main\Autoload::setClosure("Quid\Suite\Col",'OrmCell__Name',function() {

// ormCell__Name
class OrmCell__Name extends Core\Col
{
    // config
    public static $config = [
        'ignore'=>false,
        'required'=>true
    ];


    // onSet
    final public function onSet($return,array $row,?Orm\Cell $cell=null,array $option)
    {
        if(is_string($return))
        $return = Base\Str::stripEnd('abcde',$return);

        return $return;
    }


    // onGet
    final public function onGet($return,array $option)
    {
        $return = $this->value($return);

        if(is_string($return))
        $return .= 'abcde';

        return $return;
    }
}
});
}
